import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Card, CardContent } from "@/components/ui/card";
import { Button } from "@/components/ui/button";
import { Input } from "@/components/ui/input";
import { Label } from "@/components/ui/label";

const AdminUserDevices = () => {
    const [associations, setAssociations] = useState([]);
    const [userId, setUserId] = useState('');
    const [deviceId, setDeviceId] = useState('');
    const [editId, setEditId] = useState(null);

    const fetchAssociations = async () => {
        try {
            const res = await axios.get('/api/userIotDevice/'); // admin only: fetch all
            setAssociations(res.data);
        } catch (err) {
            console.error('Failed to fetch associations', err);
        }
    };

    useEffect(() => {
        fetchAssociations();
    }, []);

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            if (editId) {
                await axios.put(`/api/userIotDevice/${editId}`, {
                    user_id: userId,
                    iot_device_id: deviceId,
                });
            } else {
                await axios.post('/api/userIotDevice', {
                    user_id: userId,
                    iot_device_id: deviceId,
                });
            }
            fetchAssociations();
            setUserId('');
            setDeviceId('');
            setEditId(null);
        } catch (err) {
            console.error('Failed to submit', err);
        }
    };

    const handleEdit = (assoc) => {
        setEditId(assoc.id);
        setUserId(assoc.user_id);
        setDeviceId(assoc.iot_device_id);
    };

    const handleDelete = async (assoc) => {
        try {
            await axios.delete(`/api/userIotDevice/${assoc.id}`, {
                data: {
                    user_id: assoc.user_id,
                    iot_device_id: assoc.iot_device_id,
                },
            });
            fetchAssociations();
        } catch (err) {
            console.error('Failed to delete', err);
        }
    };

    return (
        <div className="p-4 space-y-4">
            <h2 className="text-xl font-bold">Керування пристроями користувачів</h2>

            <form onSubmit={handleSubmit} className="space-y-2">
                <div>
                    <Label>ІD Користувача</Label>
                    <Input
                        type="text"
                        value={userId}
                        onChange={(e) => setUserId(e.target.value)}
                        placeholder="user_id"
                    />
                </div>
                <div>
                    <Label>ІD Пристрою</Label>
                    <Input
                        type="text"
                        value={deviceId}
                        onChange={(e) => setDeviceId(e.target.value)}
                        placeholder="iot_device_id"
                    />
                </div>
                <Button type="submit">
                    {editId ? 'Оновити зв’язок' : 'Додати зв’язок'}
                </Button>
            </form>

            <div className="grid gap-4">
                {associations.map((assoc) => (
                    <Card key={assoc.id}>
                        <CardContent className="flex justify-between items-center p-4">
                            <div>
                                <p><strong>ID:</strong> {assoc.id}</p>
                                <p><strong>Користувач:</strong> {assoc.user_id}</p>
                                <p><strong>Пристрій:</strong> {assoc.iot_device_id}</p>
                            </div>
                            <div className="space-x-2">
                                <Button variant="outline" onClick={() => handleEdit(assoc)}>Редагувати</Button>
                                <Button variant="destructive" onClick={() => handleDelete(assoc)}>Видалити</Button>
                            </div>
                        </CardContent>
                    </Card>
                ))}
            </div>
        </div>
    );
};

export default AdminUserDevices;
